import avatar from './img/user-profile.jpg'


class Profile extends Component {
  render() {
    return (
      <div className="App">
      <section className="profile">
      <div className="profile-details">
        Name:
        Email:
        Peachy Score:
        Member Since:
      </div>
      <div className="profile-reviews">
        Restaurant Name:
        Review Date:
        Review:
      </div>
      </section>
      </div>
    );
  }
}

export default Profile;
